import React, { useState } from 'react';
import BasePage from './BasePage';
import ProfileBlocksTeacher from '../components/ProfileBlocks/Teacher/ProfileBlocksTeacher/ProfileBlocksTeacher';
import Search from '../components/ProfileBlocks/Search/Search';

const ProfileTeacher = (props) => {
  const tableData = props.tableData;
  const teacherData = props.teacherData;
  const requestData = props.requestData;
  return (
    <BasePage isAuthenticated={true} data={teacherData}>
      <Search />
      <ProfileBlocksTeacher data={teacherData} tableData={tableData} requestData={requestData}/>
    </BasePage>
  );
};

export default ProfileTeacher;
